import Nav from './Navbar'
import Foot from './Footer'
import Keep from './NoteTaker'

    // Imorting CSS :
import './index.css'



// Creating the App Component :
const App = () => {
        
    // Rendring :
    return (
        <>
        <Nav/>
        <Keep/>
        <Foot/>
        </>
        
    )
};


        // Exporting App Component :
export default App;
